import React from "react";
import "./style.scss"

function Jumbotron() {
    return (
        <div className="jumbotron jumbotron-fluid">
            <h1>Instructions</h1>
            <p>
                click on an image and earn points, dont click it more than once ! try to reach the maximum score without failing!
        </p>
        </div>
    );
}

export default Jumbotron;
